import React, { useEffect, useState } from "react";
import "./Cart.css";
import cartItems from "./cartItems.json";
import productImage from "../Assets/products/1.jpg";


const Cart = () => {

  return (
    <div className="cart-container">
        <div className="text-section"><i class="fa-solid fa-cart-shopping"></i>&nbsp;My Cart</div>
        <div className="main-cart">
            <div className="cart-list">
                <div className="cart-item">
                    <div className="cart-image">
                        <img src={productImage} alt="" className="item-img"/>
                    </div>
                    <div className="item-details">
                        <div className="heading">Product Name</div>
                        <div className="category-heading">Clothing</div>
                    </div>
                </div>
            </div>
            <div className="cart-checkout">checkout</div>
        </div>
    </div>
  );
};

export default Cart;
